fn bindgen_test_layout_slurm_errtab_t() {
    const UNINIT: ::std::mem::MaybeUninit<slurm_errtab_t> = ::std::mem::MaybeUninit::uninit();
    let ptr = UNINIT.as_ptr();
    assert_eq!(
        ::std::mem::size_of::<slurm_errtab_t>(),
        24usize,
        concat!("Size of: ", stringify!(slurm_errtab_t))
    );
    assert_eq!(
        ::std::mem::align_of::<slurm_errtab_t>(),
        8usize,
        concat!("Alignment of ", stringify!(slurm_errtab_t))
    );
    assert_eq!(
        unsafe { ::std::ptr::addr_of!((*ptr).xe_number) as usize - ptr as usize },
        0usize,
        concat!(
            "Offset of field: ",
            stringify!(slurm_errtab_t),
            "::",
            stringify!(xe_number)
        )
    );
    assert_eq!(
        unsafe { ::std::ptr::addr_of!((*ptr).xe_name) as usize - ptr as usize },
        8usize,
        concat!(
            "Offset of field: ",
            stringify!(slurm_errtab_t),
            "::",
            stringify!(xe_name)
        )
    );
    assert_eq!(
        unsafe { ::std::ptr::addr_of!((*ptr).xe_message) as usize - ptr as usize },
        16usize,
        concat!(
            "Offset of field: ",
            stringify!(slurm_errtab_t),
            "::",
            stringify!(xe_message)
        )
    );
}
